function support_init(){$(document).find("#form_support").on("submit",function(){var t=new Object;return t.token=session_key,$.ajax({url:site_url+"api/support/",data:t,method:"POST"}).fail(function(t){return console.log(t),app_status(t),!1}).done(function(t){return console.log(t),app_status(t,1),!1}),!1})}